<template>
  <div class="login">
    <div class="login-con">
      <el-card class="box-card" style=""  shadow="never">
        <div slot="header" class="clearfix" style="text-align:center;">
          <span>欢迎登录 Pure 中央系统</span>
        </div>
        <div>
          <el-form :model="from" status-icon :rules="rules" ref="ruleForm">
            <el-form-item prop="platform">
              <el-select v-model="from.platform" placeholder="请选择登录平台" class="width">
                <el-option label="后台管理系统" value="viewPlatform"></el-option>
                <el-option label="六小六系统" value="backPlatform"></el-option>
                <el-option label="中心系统" value="te"></el-option>
                <el-option label="服务器控制入口" value="te"></el-option>
              </el-select>
            </el-form-item>
            <el-form-item prop="account"><!--label="登录账户"-->
              <el-input v-model="from.account" autocomplete="off" placeholder="请输入账号"></el-input>
            </el-form-item>
            <el-form-item prop="password">
              <el-input type="password" v-model="from.password" autocomplete="off" placeholder="请输入密码"></el-input>
            </el-form-item>
            <el-form-item label="保存密码" prop="isStorage" label-width="200px">
              <el-switch v-model="from.isStorage"></el-switch>
            </el-form-item>
            <el-form-item>
              <el-button class="width" type="primary" @click="submitForm('ruleForm')">登录</el-button>
            </el-form-item>
          </el-form>
        </div>
      </el-card>
    </div>
  </div>
</template>
<script>
import { mapActions } from 'vuex'
import rules from 'utils/rules'
export default {
  name: 'Login',
  components: {
    //
  },
  data() {
    return {
      from: {
        account: '',
        platform: '',
        password: '',
        isStorage: false,
      },
      rules: {
        account: rules.checkPhone,
        password: rules.checkPwd,
        platform: [
          { required: true, message: '请选择登录平台', trigger: 'change' }
        ]
      }
    };
  },
  methods: {
    ...mapActions([
      'handleLogin',
    ]),
    submitForm(formName) {
      let platform = this.from.platform;
      let account = this.from.account;
      let password = this.from.password;
      this.$refs[formName].validate((valid) => {
        if (valid) {
          console.log(platform+" "+account+" "+password+" "+this.from.isStorage );
          this.handleLogin({platform,account, password}).then(res => {
            console.log("哈哈哈")
          });
          // handleSubmit(this.from.platform, this.from.account, this.from.password, this.from.isStorage)
        } else {
          console.log('提交失败');
          return false;
        }
      });
    },
    handleSubmit ({ platform, account, password, isStorage }) {
      this.handleLogin({ platform, account, password, isStorage }).then(res => {
        this.$router.push({
          name: this.$config.homeName
        })
      })
    }
  }
}
</script>

